import './product.css';

function Product (){
    return(
        <>
         <div class="product-box">
              <div class="product-title">Appia Life S</div>
              <div class="product-description"></div>
              <div class="product-price">Rp61.000.000</div>
            </div>
            
        </>
    )
}
export default Product;
